Як виміряти кисень у крові:
1. Розташуйте годинник на ширину одного пальця нижче кістки зап’ястя та носіть його на зап’ясті в зручному положенні; 
2. Увійшовши в режим визначення кисню в крові, залишайтеся нерухомо, переконайтеся, що ваше зап’ястя рівне, а годинник дивиться вгору. Якщо ви сидите, ви можете покласти руки на стіл так, щоб годинник дивився вгору; 
3. Тримайте руку нерухомо, доки не відобразиться остаточний результат. Зверніть увагу, що ця функція є експериментальною, значення є лише приблизними та можуть відрізнятися від реальності. Ця функція не призначена для медичного використання. Якщо у вас виникли запитання щодо вашого здоров’я, зверніться до фахівця або лікаря.
